import { TextField } from "@mui/material";
import styles from "../Content/css/FrmLogin.module.css";
import { useNavigate } from "react-router-dom";
import Api from "../API/Api";
import { FrmLoginController } from "./Controllers/FrmLoginController";


function Buscar(){    
  const xhr = new XMLHttpRequest();
        xhr.open('GET', 'http://localhost:56624/api/Usuario/GetUsuarios');
        xhr.setRequestHeader('Content-Type', 'application/json');
        xhr.setRequestHeader('Accept', 'application/json');
        xhr.onerror = function(error) {
            console.error(error);
        }
        xhr.onload = async function() {
            const result = await JSON.parse(xhr.responseText);
            console.log('data returned:', result);
            alert('Found ' + result.data.allPosts.length + ' posts');
        }
        const body = JSON.stringify({ query: 'query allPosts { allPosts { ID } }' });
        xhr.send(body);

