                label="Senha"
                size="medium"
                margin="none"
                value={Senha}
                onChange={(e)=>setSenha(e.target.value)}
              />
                <button className={styles.btnEntrarButton} onClick={Buscar}>
                  <div className={styles.txtEntrarDiv}>{`Entrar `}</div>
                </button>
                <a className={styles.txtEsqueceuASenha}>Esqueci Minha Senha</a>
              </div>              
          </div> 
        </div> 
      </form>
    </div>
  );
};
